import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Book } from 'src/app/models/book';
import { BooksService } from 'src/app/shared/books.service';
import { UserService } from 'src/app/shared/user.service';


@Component({
  selector: 'app-add-book',
  templateUrl: './add-book.component.html',
  styleUrls: ['./add-book.component.css']
})
export class AddBookComponent {

  public books: Book[];

  constructor(public booksService: BooksService, private router: Router, private UserService:UserService){
    this.booksService.getAll().subscribe((data:Book[]) => {
      this.books = data;
      console.log(data);
    })
  }

  /// asignación = !!!!!!! this.books = data, le asignamos data a los books

  //// postBooks

    addBook(id_user:number, id_book:number, title:string, type:string, author:string, price:number, photo:string):void {

      let book = new Book(
              this.UserService.user.id_user, 
              id_book,
              title, 
              type, 
              author, 
              price, 
              photo);

      this.booksService.add(book).subscribe((data:Book[])=> {
        this.books = data;
        console.log(data);
        this.router.navigateByUrl('/booksPage');
      })
  }

}




<form class="form_container">
    <h1>
        new <br> BOOK
    </h1>
    <div>
        <div class="form_child">
            <div class="form_second_child">
                <br> <br> <br> <br>
                <!-- <br><input type="number" placeholder="id user *" #id_user> <br> -->
                <br><input type="number" placeholder="id book *"  #id_book> <br>
                <br><input type="text" placeholder="Title" #title> <br>
                <br> <input type="text" placeholder="Type" #type> <br>
                <br> <input type="text" placeholder="Author" #author> <br>
                <br><input type="number" placeholder="Price" #price> <br>
                <br> <input type="url" placeholder="Photo url" #photo>
                <div class="button_div">
                    <button type="button" type="reset" class="form_buttom" (click)="addBook(id_user.value, id_book.value, title.value, type.value, author.value, price.value, photo.value)">

                        add book
                    </button>

                </div>
            </div>
                <div class="manyBooks_container">
                    <img src="/assets/img/manyBooks.jpeg" alt="" class="manyBooks">
                </div>
        </div>
    </div>
</form>


